import {MarkItDown} from '../mark-it-down'

type Props = { markdownFile: 'terms-of-use.md' };

export default function RenderMarkdown({markdownFile}: Props) {
    console.log(markdownFile);

    useEffect(() => {
        fetch(markdownFile).then(response => console.log('mdfile', response))
    })

    return (<div className="terms-of-use"/>);
}
